import { Outlet } from "react-router-dom";
import Header from "./navbar/Navbar";
import { Container } from "react-bootstrap";
// ---------------------------------------------------------------------
export default function WebsiteLayout() {
  return (
    <Container maxWidth="fluid">
      <Header />
      <Outlet />
    </Container>
  );
}
